  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Trempealeau
  NWR outlines Refuge accomplishments during the 1980 calendar year. The report begins
  with an introduction to the Refuge and information about weather conditions, habitat
  conditions, land acquisition activities, and the system status. Construction and
  maintenance, including Youth Conservation Corps (YCC) and Young Adult Conservation
  Corps (YACC) projects, are also described. Habitat management is covered; croplands,
  grasslands, and wetlands are discussed. The wildlife section of the report discusses
  endangered and threatened species, migratory birds, mammals, and non-migratory birds.
  Interpretation and recreation activities are outlined; topics include information
  and interpretation, recreation, and law enforcement. Cooperative programs, items
  of interest, and safety information are attached.\",\n\t\"license_title\": \"License
